import {Card, CardBody} from 'reactstrap';

class Content extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

    componentDidMount(){
        console.log("hola mundo");
    }

	render(){
		return(
			<Card>
				<CardBody>
					Content
				</CardBody>
				<CardBody>
					Content23
				</CardBody>
				<CardBody>
					Content23
				</CardBody>
			</Card>
		)	
	}
}

export default Content;
